import React from 'react';
import PostData from '../data/schoolProfiles.json';

function PostList() {
  return (
    <div>
      <h1>School Profiles</h1>
        <div class="row">
          {PostData.map((schoolProfile, index)=>{
            return <>
              <div class="col-sm-6">
                <div class="card">
                  <div class="card-body">
                  </div>
                  </div>
                </div>
            </>
          })}
      </div>
    </div>
  );
}

export default PostList;
